import React from 'react';
import JohnNguyenImg from './images/team/John-Nguyen.jpg';
import Christian from './images/team/Christian.jpg';
import Shane from './images/team/Shane.jpg'
const Team = () => {
  return (
    <div className="container-fluid text-center">
    <h3>Meet Our Team!</h3>
      <div className="row">
        <div className="col">
          <img src={Shane} alt="John Nguyen"/>
        </div>
        <div className="col">
          <img src={Christian} alt="John Nguyen"/>
        </div>
        <div className="col">
          <img src={JohnNguyenImg} alt="John Nguyen"/>
        </div>
      </div>
    </div>
  )
}

export default Team;
